import React from 'react';
import data from './data.json'
import styles from './App.module.css';
import Header from './components/MenuHeader';
import Menu from './components/Menu.js';
import Ostoskori from './components/Ostoskori';


const sidefiles=[


  {
    numero:'1',
    topic:'Talous',
    body:'Clubilla rahahuolet ohi.'

  },


]

const mainfiles=[
  {
    kuva: 'metto.jpg',
    topic:'Metsästys',
    body:'Kanalinnuista tehty runsaasti havaintoja Ranuan seudulla. Riistakolmio mittaukset antavat samansuuntaisia tuloksia.',
    aikajapaikka: 'Ranua 10.9.2021'
  },
  {
    kuva: 'lautta.jpg',
    topic:'Rakentaminen',
    body:'Lauttasauna etenee valtavaa vauhtia. "arviotu valmistumisaika ensi kesänä" toteaa mestari.',
    aikajapaikka: 'Simojärvi 12.9.2021'
  },
  {
    kuva: 'lynx.jpg',
    topic:'Kilpaurheilu',
    body:'Varpulampi-ojavaara ajettiin ennätysvauhtia. Reessä olevat miehet "pelotti pirusti!"',
    aikajapaikka: 'Saariharju 9.10.2021'
  },

]

function App() {

  return (

  <div>
    <Header />
    <div className={styles.paasivubar}>
      <div className={styles.maincontainer}>
         {
           mainfiles.map(element => <Menu kuva={element.kuva} topic ={element.topic} body={element.body} aikajapaikka={element.aikajapaikka}/>)  
         }
         </div>

      <div className={styles.sidecontainer}>
         {
           sidefiles.map(element => <Ostoskori numero ={element.numero} topic ={element.topic} body={element.body}/>)   
         }
 
        </div>
      </div>


    </div>
  )
}

export default App;
